import React, { Component, Fragment } from 'react';
import './Checkout.css';
import Data from './Checkout.json';

class Checkout extends Component{
	render() {
		let temp = new Date();

		let asdf = temp.getDate();

		temp.setDate = asdf.getDate + 14;
		// let time = new Date();
		console.log(asdf);
		console.log(temp);
		console.log(time.getDate);
		const CheckoutInfo = Data.data;
		return (
			<Fragment>
				<article>
					<div class="book_title">
						<h2>{CheckoutInfo.title} 대출하기</h2>
					</div>
					<div class="borrow-container">
						<div class="borrow_info">
							<h3>대출자</h3>
							<input type="text" class="info_name" placeholder="대출자 이름"/>
						</div>
						<div class="borrow_info">
							<h3>대출 일시</h3>
							<input type="text" class="info_date" placeholder="YYYY/MM/DD ~ YYYY/MM/DD" disabled/>
						</div>
						<div class="borrow_info">
							<h3>책 상태</h3>
							<input type="text" class="info_state" placeholder="책 상태를 입력해주세요."/>
						</div>
					</div>
					<div class="borrow_button">
						<form action="#borrow" method="GET">
							<input type="button" class="btn" value="대출하기"/>
						</form>
					</div>
				</article>
			</Fragment>
		);
	}
}

export default Checkout;
